import React, { FC } from "react";
import { useSelector } from "react-redux";
import { StoreType } from "../../redux/store";
import { getVideoDataList } from "../../redux/videoDataResponse";

const Home: FC = () => {
    const selector = useSelector((state: StoreType) => state);
    const videoDataResponse = getVideoDataList(selector);

    return (
        <div className="flex flex-col items-center">
            {videoDataResponse.videoDataList?.map(videoData => {
                return (
                    <div key={videoData.id}>
                        <div>{videoData.title}</div>
                        <div>{videoData.description}</div>
                        <div>{videoData.channel_name}</div>
                    </div>
                );
            })}
        </div>
    );
};

export default Home;
